import './Home.css'
import React, { useEffect, useState } from 'react';
import axios from 'axios';

export default function Home() {

    const [dataLast, setDataLast] = React.useState(null);
    const url = "http://localhost:3001/api/Home"

    React.useEffect(() => {
      axios.get(url).then((response) => {
        setDataLast(response.data);
        JSON.stringify(setDataLast)
      });
    }, []);

    if (!dataLast)
        return null;



    return (
        <div className="homeCont">
            <div className="homeWrapper">
                <h2>Dashboard</h2>
                <h3>Most recent test</h3>
                <table>
                  <th>Date</th>
                  <th>Butter Location</th>
                  <th>Robot Location</th>
                  <th>Distance to Butter</th>
                  <tbody>
                  <tr>
                    <td>{dataLast.Date_ran}</td>
                    <td>aa</td>
                    <td>12341234</td> 
                    <td>1234123</td>
                    </tr>
                 </tbody>
                </table>

            </div>
        </div>
    )
}
